create table Auction_Automobile (
	vin VARCHAR(50),
	color VARCHAR(50),
	make VARCHAR(50),
	model VARCHAR(50),
	owner VARCHAR(50),
	year INT,
	title VARCHAR(12),
	trans VARCHAR(8),
	lot_num int,
	reserve INT,
	mileage INT,
	primary key (vin),
 	foreign key (lot_num) references Location (lot_number)
);
